import React from 'react';
import FormControl from "react-bootstrap/FormControl";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import OverlayTrigger from "react-bootstrap/OverlayTrigger";
import Tooltip from "react-bootstrap/Tooltip";
import InputGroup from 'react-bootstrap/InputGroup';
import Image from "react-bootstrap/Image";
import Form from "react-bootstrap/Form";

const MyInput = ({ img, optionCount, optionEnd}) => (
                                    <Col sm={5} >
                                        <InputGroup style={{height: '45px'}}>
                                            <InputGroup.Prepend>
                                                <Image alt=''
                                                       src='https://img.icons8.com/ultraviolet/40/000000/golf-bag.png'
                                                       style={{pointerEvents: 'none'}}/>
                                            </InputGroup.Prepend>
                                            <Form.Control style={{height: '45px'}} as="select">
                                                {optionCount.map((el,key) =>{
                                                    return <option>0</option>
                                                })}

                                            </Form.Control>
                                        </InputGroup>

                                    </Col>
);
export default MyInput;
